    "2016-07-27T22:18:26.802909",nt"name": "environmental-assessment-for-the-management-of-the-greenbelt-area-at-naval-air-station-nas",nt"isopen":
    false,nt"url": null,nt"notes": "Approximately 3,595 acres of land around
    Naval Air Station (NAS) Fallon, known as the greenbelt, are out leased to local
    farmers for agricultural production. In accordance with Public Law 101-618, Section
    206, the U.S. Navy proposes a land management plan for the greenbelt to achieve
    dust control, fire abatement and safety, and foreign object damage control in a
    manner that reduces direct surface water deliveries. Over the past ten years land
    conditions in the greenbelt have degraded due to drought conditions and short-term
    land leases. This Environmental Assessment (EA) analyzes the environmental impacts
    of two alternative land management plans that achieve water savings without impairing
    the safety of flight operations. Both alternatives propose extensive water conservation
    prescriptions and different cropping patterns to achieve safety objectives and reduce
    surface water deliveries. The proposed action would potentially impact air quality,
    soils, and safety during the implementation phase. The impact would not be significant
    because mitigation management procedures would be implemented. Likewise, the alternative
    management plan would have mitigatiye short-term impacts on air quality and safety,
    but it would have significant impacts on soil conditions that could not be mitigated.
    Maintaining current management practices is evaluated as the No Action alternative
    and determined to have significant long term impacts to soil conditions and safety.",nt"license_title":
